define([],function(){var e={};return e.selectex="<div class='selectex' v-bind:class='{open: open}' tabindex='0' v-on:keydown='onKeyDown'>\r\n    <div style='white-space: nowrap; display: flex; justify-content: space-between; align-items: center;' v-on:click='toggleOpen'>\r\n        <template v-if='value != null'>\r\n            <span style='overflow: hidden; text-overflow: ellipsis; width: 100%; display: block;' v-html='getValueHtml(value)'></span>\r\n            \x3c!--<span v-on:click=\"clear\">x</span>--\x3e\r\n            <img v-on:click=\"clear\" src=\"img/delete.svg\">\r\n        </template>\r\n        <template v-else>\r\n            <span style=\"\">{{placeholder}}&nbsp;</span>\r\n            \x3c!--<span style=\"transform: rotate(270deg); color: #1453b1; font-weight: bold;\"> > </span>--\x3e\r\n            <img src=\"img/arrow-sort-active.svg\">\r\n        </template>\r\n    </div>\r\n    <div v-if='open' class='drop-down'>\r\n        <div class='search'>\r\n            <div><input type='text' v-model='search'></div>\r\n        </div>\r\n        <div style='max-height: 300px; overflow-y: auto;'>\r\n            <div class='option' v-bind:class='{selected: option == value}' v-for='(option, index) in filteredOptions' v-on:click='selectOption(option)'>\r\n                <slot><span v-if='option != null' v-html='getValueHtml(option)'></span></slot>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>",e});